/*  
Note: From the dataset on website:
- Change the TIMESTAMP column to DATETIME2.
- Change the BOOLEAN column to BIT.
- Change values of the BOOLEAN column: 't' --> 1 and 'f' --> 0.
*/

CREATE TABLE balanced_tree.dbo.product_hierarchy (
  "id" INTEGER,
  "parent_id" INTEGER,
  "level_text" VARCHAR(19),
  "level_name" VARCHAR(8)
);


CREATE TABLE balanced_tree.dbo.product_prices (
  "id" INTEGER,
  "product_id" VARCHAR(6),
  "price" INTEGER
);


CREATE TABLE balanced_tree.dbo.product_details (
  "product_id" VARCHAR(6),
  "price" INTEGER,
  "product_name" VARCHAR(32),
  "category_id" INTEGER,
  "segment_id" INTEGER,
  "style_id" INTEGER,
  "category_name" VARCHAR(6),
  "segment_name" VARCHAR(6),
  "style_name" VARCHAR(19)
);


CREATE TABLE balanced_tree.dbo.sales (
  "prod_id" VARCHAR(6),
  "qty" INTEGER,
  "price" INTEGER,
  "discount" INTEGER,
  "member" BIT,
  "txn_id" VARCHAR(6),
  "start_txn_time" DATETIME2
);
















